the final stage of the Open Championship.\n\nOn YouTube and my personal website (www.dannymaude.com) I will bring you the most up to date training, training that is getting tangible results for my clients right now.  I don’t know where you are in your golfing journey, you could be just starting out or maybe your body isn’t as flexible as it once was or you’ve got ambitions to slash your handicap.  Wherever you are I’ve created a place here you can learn, share your ideas, ask questions and get all the support you need to enjoy this great game.\n\nBe prepared though. If its a quick fix you are after Im not your man. Here I will give you step-by-step advice that you can take straight to the practice ground and apply to the course but it will require you to get stuck in, screw up…a lot, practice some more and then watch those scores tumble\n\nI’ve had the pleasure of coaching thousands of students all around the world and if you are up for the challenge and are ready to get in the game…LETS GO TO WORK!\n\n-----------------------\nSUBSCRIBE!!\n-----------------------\n"},{"text":"https://www.youtube.com/channel/UCSwd...","navigationEndpoint":{"clickTrackingParams":"CI4BEM2rARgBIhMI9sffr9uJ6gIVVYB7Ch0jzgyGSPa7k4LUyMOfQw==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/channel/UCSwdmDQhAi_-ICkAvNBLEBw?sub_confirmation=1","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/channel/UCSwdmDQhAi_-ICkAvNBLEBw?sub_confirmation=1","nofollow":true}}}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CI8BEJsrIhMI9sffr9uJ6gIVVYB7Ch0jzgyG","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRe . If its a quick fix you are after Im not your man. Here I will give you step-by-step advice that you can take straight to the practice ground and apply to the course but it will require you to get stuck in, screw up…a lot, practice some more and then watch those scores tumble\n\nI’ve had the pleasure of coaching thousands of students all around the world and if you are up for the challenge and are ready to get in the game…LETS GO TO WORK!\n\n-----------------------\nSUBSCRIBE!!\n-----------------------\nhttps://www.youtube.com/channel/UCSwdmDQhAi_-ICkAvNBLEBw?sub_confirmation=1","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/Qz8ORUBE3fY/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDMyrJ_ueCFSvDdeSpkbgxJ1tOF1A","width":168,"height":94},{"url":"https://i.ytimg.com/vi/Qz8ORUBE3fY/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLAcy_WZ0IOs3W9UvsfgI13s9KaFxg","width":196,"height":110},{"url":"https://i.ytimg.com/vi/Qz8ORUBE3fY/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBMMACfeAEJgrOK8VeaoRkLE5lT3g","width":246,"height":138},{"url":"https://i.ytimg.com/vi/Qz8ORUBE3fY/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDb9msFfGHjkwgIIvbPTLRbg40vnw","width":336,"height":188},{"url":"https://i.ytimg.com/vi/Qz8ORUBE3fY/maxresdefault.jpg","width":1920,"height":1080}]},"useCipher":false,"averageRating":4.9276724,"allowRatings":true,"viewCount":"1330850","author":"Danny Maude","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"607000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/SwdmDQhAi_-ICkAvNBLEBw/featured_channel.jpg?v=5e2cb85b","width":40,"height":40}]},"trackingParams":"CEwQ8zciEwi4xt-v24nqAhUXud4KHYblCFg=","navigationEndpoint":{"clickTrackingParam be.com/v/Qz8ORUBE3fY?version=3\u0026autohide=1","width":1280,"height":720,"flashSecureUrl":"https://www.youtube.com/v/Qz8ORUBE3fY?version=3\u0026autohide=1"},"title":{"simpleText":"STOP TOPPING YOUR WOODS - Learn to hit a wood off the ground"},"description":{"simpleText":"How to stop  topping your golf shots, specifically your woods including fairway woods and your hybrids.  What you will learn will help your stop topping any shot including your irons and your driver but Danny in this video Danny puts particular emphasis on your fairway woods and hybrids.\n\nPlayers like Tiger Woods, Rory Mcilroy, Jason Day and Dustin Johnson are wonderful hybrid and fairway wood players and no matter your age or ability you can copy simple things that they do to eliminate the top shot for good.\n\nLearn this and more in this weeks golf lesson, plus as a massive thank you for supporting my channel I'd like to give you two bonus videos that will help you to generate more distance and accuracy off the tee too. \n\n▶CLICK LINK BELOW TO RECEIVE FREE VIDEOS\nhttps://www.dannymaude.com/opt-in\n\nIf you like the video give it a thumbs up , maybe share it with a friend and if you want to see more like this you can subscribe to the channel for FREE below:\n\n▶Become a FREE subscriber\nhttps://www.youtube.com/channel/UCSwdmDQhAi_-ICkAvNBLEBw?sub_confirmation=1\n\n▶RECEIVE FREE WEEKLY GOLF VIDEOS\nhttps://dannymaude.com/p/newsletter-sign-up\n\n▶ADD 25 YARDS TO YOUR DRIVES - FREE DRIVER SERIES\nhttps://www.dannymaude.com/opt-in\n\n▶BOOK  A LESSON\nEMAIL: support@dannymaude.com\n\n▶ VISIT OUR WEBSITE:\nhttp://dannymaude.com\n\n▶ INSTAGRAM:\nhttps://www.instagram.com/dannymaude\n\n▶ FACEBOOK:\nhttps://www.facebook.com/dannymaudefan\n\n▶ TWITTER:\nhttps://www.twitter.com/dannymaude\n\n-----------------\nASK DANNY A QUESTION:\n-----------------\n#dannymaudegolf \nhttp://www.dannymaude.com\nhttps://www.facebook.com/dannymaudefan\nhttps://www.instagram.com/dannymaude\nhttps://uk.linkedin.com/in/dannymaude\n\n-----------------------\nABOUT DANNY\n-----------------------\nThanks for stopping by.  I created this website as a resource just for you to support you on your golfing journey as I know how tricky learning this game can be…to say the least!\n\nI personally found learning the game too long and difficult in the early days. I read all the books, watched all the videos but my game was not improving. Then after studying various forms of neuro science, motor learning, psychology and personal development in less than two years I went from struggling golfer to the final stage of the Open Championship.\n\nOn YouTube and my personal website (www.dannymaude.com) I will bring you the most up to date training, training that is getting tangible results for my clients right now.  I don’t know where you are in your golfing journey, you could be just starting out or maybe your body isn’t as flexible as it once was or you’ve got ambitions to slash your handicap.  Wherever you are I’ve created a place here you can learn, share your ideas, ask questions and get all the support you need to enjoy this great game.\n\nBe prepared though. If its a quick fix you are after Im not your man. Here I will give you step-by-step advice that you can take straight to the practice ground and apply to the course but it will require you to get stuck in, screw up…a lot, practice some more and then watch those scores tumble\n\nI’ve had the pleasure of coaching thousands of students all around the world and if you are up for the challenge and are ready to get in the game…LETS GO TO WORK!\n\n-----------------------\nSUBSCRIBE!!\n-----------------------\nhttps://www.youtube.com/channel/UCSwdmDQhAi_-ICkAvNBLEBw?sub_confirmation=1"},"lengthSeconds":"607","ownerProfileUrl":"http://www.youtube.com/user/TransformGolf","externalChannelId":"UCSwdmDQhAi_-ICkAvNBLEBw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE"
